type RecipeProps = {
  title: string;
  subtitle: string;
  description: string;
  amount: number;
  ingredient: string;
};

const Recipe = (recipe: RecipeProps) => {
  return (
    <article>
      <h1>{recipe.title}</h1>
      <h2>{recipe.subtitle}</h2>
      <p>{recipe.description}</p>
      <div>
        <span>{recipe.amount}</span>
        <span>{recipe.ingredient}</span>
      </div>
    </article>
  );
};

export default Recipe;
